#!/usr/bin/perl

# grab output of get_lethal.pl and sort by WBGene.  for Carol  2006 09 11 

use strict;

my $outfile = 'outfile';

my %sort;		# lethal phenotypes
open (IN, "<$outfile") or die "Cannot open $outfile : $!";
while (<IN>) { 
  chomp;
  my ($a, $b, $c, $gene) = split/\t/, $_;
  push @{ $sort{$gene} }, $_; }
close (IN) or die "Cannot close $outfile : $!";

foreach my $gene (sort keys %sort) {
  foreach my $line (@{ $sort{$gene} }) { print "$line\n"; }
} # foreach my $gene (sort keys %sort)

__END__

